import React, { Component } from 'react';
import { Table } from 'antd'
export default class shop extends Component {
    // constructor(props) {
    //     super(props)
    // }
    dataSource = [{
        key: '1',
        name: '胡彦斌',
        age: 32,
        address: '西湖区湖底公园1号'
    }, {
        key: '2',
        name: '胡彦祖',
        age: 42,
        address: '西湖区湖底公园1号'
    }];
    columns = [{
        title: '姓名',
        dataIndex: 'name',
        key: 'name',
    }, {
        title: '年龄',
        dataIndex: 'age',
        key: 'age',
    }, {
        title: '住址',
        dataIndex: 'address',
        key: 'address',
    }];

    render() {
        return (
            <div>
                <Table
                    bordered  //-- 是否展示外边框
                    dataSource={this.dataSource}
                    columns={this.columns}
                />
            </div>
        )
    }
}
